import React from 'react';
import Alisson from "./ali.jpeg"
import navbarHeart from './navbar-heart.png';


class Card extends React.Component {
    render() {
      return (
        <div className="card">
        <div>
        <img src={Alisson} alt="alisson" height="500px" width="500px"/>
        <button><img src={navbarHeart} alt="navbarHeart" height="50px" width="50px"/></button>
        </div>
        </div>

      )
    }
  }
  export default Card;
